import {RouterProvider} from "react-router-dom";
import router from "./router";
import React from "react";
import Navbar from "./components/Navbar";

function App() {
    return (
        <div className={"App"}>
            <Navbar>
                <RouterProvider router={router}/>
            </Navbar>
        </div>
    );
}

export default App;
